function isLoggedIn(){return null!=f.getAuth()}function currentProfile(e){return userProfile(getCurrentProfileId(),e)}function userProfile(e,t){return f.child(e).once("value",t)}function loadAllProfiles(e){return f.once("value",e)}function addProfile(e){var t={name:"name here",email:"email <here></here>",website:"",imageUrl:"http://i.imgur.com/RDt7RuO.png",fotos:{foto1:"http://i.imgur.com/o3qfnjm.png",foto2:"http://i.imgur.com/IRlsyAZ.png"}};f.child(e).set(t)}function getCurrentProfileId(){return f.getAuth().uid.substring(f.getAuth().uid.length-2,f.getAuth().uid.length)}function updateProfile(e){f.child(getCurrentProfileId()).set(e)}var f=new Firebase("https://projectoni.firebaseio.com/");